package main

import (
	"fmt"
	"strconv"
)

type Fraction struct {
	numerator   int
	denominator int
}

// This function returns -1 if the fraction is less than other
// returns 0 if they are equal, 1 if its greater than other.
func (f *Fraction) compareTo(other *Fraction) int {
	val := f.numerator*other.denominator - other.numerator*f.denominator
	if val > 0 {
		return 1
	} else if val < 0 {
		return -1
	}
	return 0
}

func (f *Fraction) String() string {
	return strconv.Itoa(f.numerator) + "/" + strconv.Itoa(f.denominator)
}

// Sort a list of fractions in sorted order
func sort(l []*Fraction, k int) []*Fraction {
	//for i, val := range l {
	//	min := val
	//	index := i
	//	for j := i; j < len(l); j++ {
	//		//find the minimum in this array;
	//		if min.compareTo(l[j]) == 1 {
	//			min = l[j]
	//			index = j
	//		}
	//	}
	//	temp := val
	//	l[i] = min
	//	l[index] = temp
	//}
	// at this point the array is sorted

	if len(l) <= 1 {
		return l
	}

	a1 := sort(l[0 : len(l)/2])
	a2 := sort(l[len(l)/2:])

	return merge(a1, a2, k)
}

func merge(a, b []*Fraction) []*Fraction {
	i, j := 0, 0
	final := make([]*Fraction, 0)
	for k := 0; k < len(a)+len(b); k++ {
		if i < len(a) && j < len(b) {
			if a[i].compareTo(b[j]) < 0 {
				final = append(final, a[i])
				i = i + 1
			} else {
				final = append(final, b[j])
				j = j + 1
			}
		} else if i < len(a) {
			final = append(final, a[i])
			i = i + 1
		} else if j < len(b) {
			final = append(final, b[j])
			j = j + 1
		}
	}
	return final
}

func kthSmallestPrimeFraction(A []int, K int) []int {
	l := getFractions(A)
	l = sort(l)
	return getGCDRepresentation(l[K-1])
}

func getGCDRepresentation(f *Fraction) []int {
	gcd := getGCD(f.numerator, f.denominator)
	f.denominator = f.denominator / gcd
	f.numerator = f.numerator / gcd
	return []int{f.numerator, f.denominator}
}

func getGCD(num1, num2 int) int {
	if num2 != 0 {
		return getGCD(num2, num1%num2)
	}
	return num1
}

func getFractions(A []int) []*Fraction {
	answer := make([]*Fraction, 0)
	for i := 0; i < len(A); i++ {
		for j := i + 1; j < len(A); j++ {
			answer = append(answer, &Fraction{A[i], A[j]})
		}
	}

	return answer
}

